class FrontPage extends React.Component {
  constructor(props){
    super(props);
    this.stomach_pressure = {value:''};
    this.flow_rate = {value:''};


    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  renderBtn(i) {
    // return <SubmitBtn />;
  }

  handleChange(event){
    this.setState({value: event.target.value});
  }

  handleSubmit(event) {
    alert('A stomach pressure was submitted: ' + this.state.value);
    event.preventDefault();
  }

  render() {
    return (
      <div>
        <br></br>
        <div className="row">
          {this.renderBtn()}
        </div>
        <form onSubmit={this.handleSubmit}>
        <label>
        Enter baby stomach pressure:
          <input className="stomach-pressure" type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <br></br>
        <br></br>
        <label>
        Enter feed flow rate:
          <input className="flow-rate" type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Submit" />
      </form>
      </div>
    );
  }
}

